import React from "react";
import FunkoWishlist from "../components/FunkoWishlist";

const FunkosSearchResultContainer = props => {
  return (
    <div className="funko-collection">
      {props.funkos.map(funko => {
        return (
          <FunkoPage
            key={wishlist.id}
            wishlist={wishlist}
            selectWishFunko={props.selectWishFunko}
          />
        );
      })}
    </div>
  );
};

export default FunkosSearchResultContainer;
